import React from 'react';
import styles from './TryAgainButton.module.css';

function TryAgainButton({ onClick }) {
  return (
    <button className={styles.tryAgainButton} onClick={onClick}>
      Спробувати ще раз
    </button>
  );
}

export default TryAgainButton;
